import { products } from "../data/products";

interface CheckBasketProductProps {
    id: number
}

export function BasketProduct({ id }: CheckBasketProductProps){
    return( 
        <>
        <div className="basketItems p-5">
            <div className="p-2 d-flex flex-row">
                <div className="p-2">
                    <img src={products[id].imageSecond} height={150} alt="product" />
                </div>
                <div className="p-2">
                    <h1> {products[id].title} </h1>
                    <p> {products[id].description} </p>
                </div>
            </div>
            <div className="p-2">
                <h1> {products[id].price} ₽</h1>
            <button>удалить</button>
            </div>
        </div>
        </>
    );
}
